function MidDesText() {
  return (
    <div className="four-mid-des-text">
      "Taking the experience a visitor has to your website to new heights
      depends on the attention to detail. Navigating through your business site
      must be appealing and simple, while instructional and friendly"
    </div>
  );
}

export default MidDesText;
